import './RegisBtn.css';
import { useNavigate } from 'react-router-dom';
import { TweenMax, Expo } from 'gsap';
import React from 'react';

// Register Btn view
export default function RegisBtn() {

 const navigation = useNavigate();
 const handleNavigation = (event) => {
  event.preventDefault();
  navigation('register-phone');
 };

 React.useEffect(() => {
  TweenMax.from('.btn-transition button', 1.2, { delay: .7, opacity: 0, y: 30, ease: Expo.easeIn })

 }, []);

 return (
  <div className='btn-transition'>
   <button onClick={handleNavigation}>Register</button>
  </div>
 );
};
